import React from 'react';
import Form from './Form';
import ImgLogin from './ImgLogin';
import img from '../../images/bq.jpg'


const Login = (props) => {

  return (
    <>
    <div className= 'container-login'>
    <main data-testid="login" className='container d-flex fill-available justify-content-center align-items-center'>

       <div className="col-lg-6 opacyty-login">
       <div
         className="col-lg-12 py-3 d-flex align-items-center form-style flex-column opacyty-login-top">
         <Form logprop={props} />
       </div>
       </div>
       <ImgLogin
         imgSrc={img}
         cssClass="col-lg-6 justify-content-center text-align img"
         imgClass="img-fluid"
       />
     </main>
    </div>

    </>
  )
}
export default Login
